import React from 'react'
import { useNavigate } from 'react-router'
// import GoogleLogin from 'react-google-login'
// import {FcGoogle} from 'react-icons/fc'


const Login = () => {
    const navigate = useNavigate();
    const CLIENT_ID = "1090350547929-lqosq4oc2pd2q7fnbn60tscegsdpgca6.apps.googleusercontent.com"

    const responseGoogle = (response) => {
        console.log(response);
        navigate("/");
    }


    return (
        <div className="container col-md-5 mt-4">
        <h1>Enter your login details</h1>
        {/* <GoogleLogin 
          clientId= {CLIENT_ID}
          cookiePolicy={'single_host_origin'}
          buttonText='Login with Google'
          onSuccess={responseGoogle}

        /> */}

        <div className="mb-3 mt-3">
        <i class="user icon"></i>
        <label  className="form-label">Username</label>
        <input type="username" className="form-control" id="exampleFormControlInput1" placeholder="Enter username"/>
        </div>
        <div className="mb-3">
        <i class="large keyboard icon"></i>
        <label  className="form-label">Password</label>

        <input type="password" className="form-control" id="exampleFormControlInput1" placeholder="Enter Password"/>
        </div>
        <div align="center" className='d-grid gap-2'>
        <button type="button" className="btn btn-dark" onClick={ () => {navigate("/")}}>Login</button>
        </div>
        </div>





    )
}

export default Login;
